import React, { useContext, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { ContextNavigate } from "../ContextProvider/Context";
import "./Dashboard.css";

const Dashboad = () => {
  const { setUserData } = useContext(ContextNavigate);
  // console.log(userdata);

  const history = useNavigate();

  const dashfetchData = async () => {
    const token = await localStorage.getItem("userDataToken");
    //     console.log(token);

    const data = await fetch("http://localhost:4000/validUser", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        Authorization: token,
      },
    });

    const res = await data.json();
    //     console.log(res);

    if (res.status === 205) {
      // console.log(res);
      setUserData(res);
      // history("/home");
    } else {
      console.log("userData not found");
      history("*");
    }
  };

  useEffect(() => {
    dashfetchData();
  });

  const addTocart = async () => {
    // history('/cart');

    const card = {
      id: "card-1",
      name: "Product-1",
      price: 25,
    };

    const token = await localStorage.getItem("userDataToken");
    // console.log(token);

    const data = await fetch("http://localhost:4000/addToCart", {
      method: "POST",
      headers: {
        "content-type": "application/json",
        Authorization: token,
      },
      body: JSON.stringify({ ...card }),
    });

    const res = await data.json();
    console.log(res);
  };

  return (
    <>
      <div className="dash">
        <div className="product">
          <div className="card">
            <div className="img">
              <img
                src="data:image/jpeg;base64,"
                alt="img"
              />
            </div>
            <div className="content">
              <h3>Card</h3>
              <div className="action">
                <p>$198</p>
                <button onClick={addTocart} className="btn btn-success">
                  Add to cart
                </button>
              </div>
            </div>
          </div>

          <div className="card">
            <div className="img">
              <img
                src="data:image/jpeg;base64,"
                alt="img"
              />
            </div>
            <div className="content">
              <h3>Card</h3>
              <div className="action">
                <p>$198</p>
                <button onClick={addTocart} className="btn btn-success">
                  Add to cart
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dashboad;
